const Links = () => {
    return ( 
        <div class="link-section">
            <a class ="link-item" href="https://learn.fullstackacademy.com/workshop">Fullstack Workshops (aka LearnDot)</a>
                <a class ="link-item" href="https://fullstackacademy.slack.com/">Bootcamp Slack Channel </a>
                    <a class ="link-item" href="https://www.netlify.com/">Netlify website managing</a>
                    <a class ="link-item" href="https://github.com/FullstackAcademy/2301-FTB-MT-WEB-FT">2301-FTB-MT-WEB-FT Github Repo</a>
                    <a class ="link-item" href="https://www.sleepopolis.com/calculators/sleep">Calculate my sleep</a>
                    <a class ="link-item" href="https://fullstack.instructure.com">Fullstack Academy Portal </a>
                <p>Test?</p>
        </div>
    )
}

export default Links;
